\narrays.check_contract()\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;p&gt;&lt;b&gt;Source:&lt;/b&gt; @source &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Destination:&lt;/b&gt; @destination &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Bandwidth:&lt;/b&gt; @bandwidth_text / s&lt;/p&gt;\n            &lt;/div&gt;\n            "},"id":"1179","type":"HoverTool"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1337"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1339"},"nonselection_glyph":{"id":"1338"},"view":{"id":"1341"}},"id":"1340","type":"GlyphRenderer"},{"attributes":{"data":{"cpu":["min: 4.0%","max: 95.6%","m
